@EU_Commission @Antimyon106 🇪🇺 is English-only
At least according to the practice of the Twitter account of the European Commission
If you want to reach your citizens, use all their languages

@EU_Commission I see the propaganda,but let's have a bit less hype and a bit more scrutiny.
If you keep telling us how wonderful you are, we'll eventually believe it, is it?
The Germans tried that technique and it didn't end well. 🇬🇧

@EU_Commission Is the Borg.
Is assimilating.
Is grabbier than a grabby thing with grabbing disease.

@EU_Commission There are two predominant propaganda purveyors utilising Twitter, they are:
1. The Russian Federation
2. The European Union

@EU_Commission 🇪🇺 is irreversible neoliberalism
🇪🇺 is lack of national sovereignty
🇪🇺 is fake coexistence

@EU_Commission WAR IS PEACE

FREEDOM IS SLAVERY

IGNORANCE IS STRENGTH

@EU_Commission I don’t need your protection.

EU doesn’t need US private companies to police its political debate and doesn’t need censorship.

What you are doing is humiliating and anti European.
